import React, {useEffect, useState} from "react";
import { Link } from "react-router-dom";

function Events() {
    const [items, setItems] = useState([]);

    useEffect(() => {
        fetch('/events', {
            method: 'GET',
            'headers': {
                'Content-type': 'application/json'
            },
        })
    }, []);

    return (
        <section>
            {
                items.map(item => {
                    <div>
                        <p>{item.name}</p>
                        <p>{item.msg}</p>
                        <p>{item.username}</p>
                    </div>
                })
            }
        </section>
    );
}

export default Events;
